import {ReactComponent as GithubIcon} from 'assets/img/github.svg'

function Navbar(){

    return(
        <header>
    <nav className="container">
      <div>
        <h1>DSMvoie</h1>
        <a href="https://github.com/devsuperior" target="_blank" rel="noreferrer">
          <div>
            <GithubIcon />
            <p>/devsuperior</p>
          </div>
        </a>
      </div>
    </nav>
  </header>
    );

}

export default Navbar;
